سے ستایا مفلوک الحال طبقہ بیماری کا علاج تو دورادویات بھی خریدنے سے قاصر ہے ایسے میں NICVD# جیسے مزید ہسپتال کا قیام عوام کی بنیادی ضرورت ہے۔اب آپ اسے تشہیر سمجھیں یاکچھ اورعوام کی خدمت پر اسے سراہا بھی جانا چاہئے اور مزید ایسے اقدام کیلئے حکومت کا حوصلہ بڑھانا بھی چائیے
